import React from 'react';
import Accueil from './pages/Accueil';
import Series from './pages/Series';
import Movies from './pages/Movies';
import Error from './pages/Error';
import Sample from './feed/sample.json';
import Axios from 'axios';
import{ Card, Col, Row} from 'react-bootstrap';
import {
  BrowserRouter as Router,
  Route,
  Switch
} from 'react-router-dom';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state =({
      series: ""
    })
  }

  componentMount(){
    let url= "/home/bah/Documents/Stage/DiShop/dishop/src/feed/sample.json";
    Axios.get(url+"&sort_by=title.asc&page=2")
      .then(response => {
        return response.data.entries
          this.setState({
            series: response.data.entries
          })
      }
      )
  }

  render() {
    return (
      <Router>
        <Switch>
          <Route exact path="/" component={Accueil} />
          <Route exact path="/Series" component={Series} data={this.state.series}/>
          <Route exact path="/Movies" component={Movies} />
          <Route component={Error} />
        </Switch>
      </Router>

    );
  }
}

export default App;
